import React from "react"
import Pembagian from "./pembagian";
import Pengurangan from "./pengurangan";
import Penjumlahan from "./penjumlahan";
import Perkalian from "./perkalian";

const Calculator = () => {


    return (
      <div>
       
          <Penjumlahan />
          <Pengurangan />
          <Pembagian />
          <Perkalian />
         
      </div>
    )
};

export default Calculator;
